import React, { Fragment } from 'react';


const Posts = ({ posts }) => {

    return (
        <div class="posts">
        {
           posts.map((post) => {
               const {description, location, price, title, _id} = post;
             return (
                 <div class='card' key={_id} >
             <h3>{title}</h3>
             <p>Description: {description}</p>
             <p>Price: {price}</p>
             <p>Location: {location}</p>
             </div>
             )  
           }) 
        }
        </div>
    )
}

export default Posts;
